import './App.css';
import image from './woman-grocery-list.jpeg';

function App() {
  return (
    <div>
      <img src={ image } width="300px" alt="grocery list"/>
      <h1>Grocery List</h1>
      <img></img>
    </div>
  );
}

export default App;
